import React from 'react'
import { render } from 'react-dom'
import '../../App.css';
import Nav from 'react-bootstrap/Nav';
import { MDBIcon, MDBContainer, MDBBtn } from 'mdbreact';


export default class PatientTable extends React.Component {


 createMain(props){

    return (

        // <div class="main">

        // <div class="position-relative overflow-hidden p-3 p-md-5 m-md-3 text-center landing_field">
        // <div class="container-main">
        // <img src="./touchable_landing.png" alt="Norway"></img>
        // <div class="text-block-main">
        // <div class="text-block-main2">
        // <img src="https://zerodebug.com/images/ta_logo_2048.png" width="50"></img>
        // <h1 class="display-4 display-44 font-weight-normal">touchAble Pro</h1>
        // <p class="lead font-weight-normal">total control over Ableton Live with your mobile devices</p>
        // <div class="store-icon-list">
        // <ul class="list-group list-group-horizontal">
        // <li class="list-group-item flex-fill"><a class="store-button btn btn-outline-secondary btn-block." href="#"><i class="fa fa-apple" aria-hidden="true"></i>  iOS</a></li>
        // <li class="list-group-item flex-fill"><a class="store-button btn btn-outline-secondary btn-block." href="#"><i class="fa fa-android" aria-hidden="true"></i>  Android</a></li>
        // <li class="list-group-item flex-fill"><a class="store-button btn btn-outline-secondary btn-block." href="#"><i class="fa fa-windows" aria-hidden="true"></i>  Windows</a></li>
        // </ul>
        // </div>
        // </div>
        // </div>
        // </div>
        // </div>


        // </div>

        <ul class="list-group list-group-horizontal">
        <li class="list-group-item flex-fill"><a class="store-button btn btn-outline-secondary btn-block." href="#"><i class="fa fa-apple" aria-hidden="true"></i>  iOS</a></li>
        <li class="list-group-item flex-fill"><a class="store-button btn btn-outline-secondary btn-block." href="#"><i class="fa fa-android" aria-hidden="true"></i>  Android</a></li>
        <li class="list-group-item flex-fill"><a class="store-button btn btn-outline-secondary btn-block." href="#"><i class="fa fa-windows" aria-hidden="true"></i>  Windows</a></li>
        </ul>

        )

}

 createNavbar(){

    return (

        <nav class="navbar fixed-top-2 navbar-dark bg-dark navbar-expand-md bg-faded justify-content-center">
        <a class="navbar-brand" href="#">
        <img src="https://zerodebug.com/images/ta_logo_2048.png" width="25"></img>
        </a>  
        <a class="navbar-brand" href="#">touchAble</a> 
        <ul class="navbar-nav w-100 justify-content-start">
        <li class="nav-item active">
        <a class="nav-link" href="#">manual</a>
        </li>
        <li class="nav-item">
        <a class="nav-link" href="//codeply.com">install</a>
        </li>
        <li class="nav-item">
        <a class="nav-link" href="#">server</a>
        </li>
        <li class="nav-item">
        <a class="nav-link" href="#">faq</a>
        </li>
        </ul>
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#collapsingNavbar3">
        <span class="navbar-toggler-icon"></span>
        </button>
        <div class="navbar-collapse collapse w-100" id="collapsingNavbar3">

        <ul class="nav navbar-nav ml-auto w-100 justify-content-end">
        <li class="nav-item">
        <a class="nav-link" href="https://www.facebook.com/touchableapp/" title="Facebook" target="_blank"><i class="fa fa-facebook" aria-hidden="true"></i></a>
        </li>
        <li class="nav-item">
        <a class="nav-link" href="https://www.twitter.com/touchableapp/" title="Twitter" target="_blank"><i class="fa fa-twitter" aria-hidden="true"></i></a>
        </li>
        <li class="nav-item">
        <a class="nav-link" href="https://www.instagram.com/touchableapp/" title="Instagram" target="_blank"><i class="fa fa-instagram" aria-hidden="true"></i></a>
        </li>
        <li class="nav-item">
        <a class="nav-link" href="https://www.instagram.com/touchableapp/" title="Instagram" target="_blank"><i class="fa fa-youtube" aria-hidden="true"></i></a>
        </li>
        </ul>
        </div>
        </nav>


        )

}


    render() {
        return (

            this.createNavbar()


            );
    }

}
